import Banner from '../Banner/Banner';
import AboutProject from '../AboutProject/AboutProject';
import Stack from '../Stack/Stack';
import AboutMe from '../AboutMe/AboutMe';
import './Main.css';

function Main({ isLoggedIn }) {
  return (
    <main className='content'>
      <Banner />
      <AboutProject />
      <Stack />
      <AboutMe />
    </main>
  );
}

export default Main;
